  false,\n\t\"url\": null,\n\t\"notes\": \"Using radio-telemetry, female northern
  pintail (Anas acuta) survival, distribution, and movements during late August-March
  in Central California were determined during 1991-92, 1992-93, and 1993-94. Accuracy
  of individual data fields has been reviewed. Data collection for 1991-94 is complete
  although additional years may be added. WHAT EACH RECORD REPRESENTS: Each record
  contains data about a duck's location, as well as information about the duck and
  hunting conditions at the time of observation.\",\n\t\"license_title\": null,\n\t\"extras\":
